import './App.css';
import HomeImg from './Images/home.svg';
import LibraryImg from './Images/library.svg';
import ExploreImg from './Images/explore.svg';
import LogoImg from './Images/logo_dark.svg';
import SearchImg from './Images/searchNew.svg';
import CastImg from './Images/cast.svg';
import ProfileImg from './Images/account.svg';
import MenuImg from './Images/menu.svg';
import CloseImg from './Images/close.svg';
import AddImg from './Images/add.svg';

import { useState, useEffect } from 'react';
import { waitFor } from '@testing-library/react';

function App() {
  const [menuOpen, setMenuOpen] = useState(false);
  const handleStateMenu = (e) => {
    setMenuOpen(e);
  };

  // useEffect(() => {
  //   menuOpen ? <MenuDrawer setMenu={handleMenuClick} /> : console.log("menu cosed")
  // }, [setMenuOpen]);

  return (
    <div className="App">
      <div className='HomeContent'>

        <div className='CategoryParent'>
          <SongCategory CategoryName='Podcast' />
          <div className='SongCategory'>
            <p>Calm</p>
          </div>
          <div className='SongCategory'>
            <p>Romance</p>
          </div>
        </div>

        <div>
          <h2 className='Content Heading'>Listen Again</h2>
          <div className='TrackParent'>
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
          </div>
        </div>

        <div>
          <h2 className='Content Heading'>Top Songs</h2>
          <div className='TrackParent'>
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
          </div>
        </div>

        <div>
          <h2 className='Content Heading'>Mixed For You</h2>
          <div className='TrackParent'>
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
            <TrackDetails />
          </div>

          <div>
            <h2 className='Content Heading'>Global Top</h2>
            <div className='TrackParent'>
              <TrackDetails />
              <TrackDetails />
              <TrackDetails />
              <TrackDetails />
              <TrackDetails />
              <TrackDetails />
            </div>
          </div>
        </div>
      </div>

      <LeftBar />

      <TopBar setMenu={setMenuOpen} />

      {menuOpen && (<MenuDrawer setMenu={handleStateMenu} />)};

    </div>
  );
}

function TopBar({ setMenu }) {

  return (
    <div className='TopBar'>
      <button className='Menu' onClick={() => setMenu(true)}><div><img src={MenuImg}></img></div></button>
      <img className='Logo' src={LogoImg} ></img>
      {/* TopBar Left btns  */}
      <button className='Search'><img src={SearchImg}></img></button>
      <button className='Cast'><img src={CastImg}></img></button>
      <button className='Profile'><img src={ProfileImg}></img></button>
    </div >

  );
}

function LeftBar() {
  return (
    <div className='LeftBar'>
      <button className='Home'><img src={HomeImg}></img>Home</button>
      <button className='Explore'><img src={ExploreImg}></img>Explore</button>
      <button className='Library'><img src={LibraryImg}></img>Library</button>
    </div>
  )
}

function MenuDrawer({ setMenu }) {

  // Close Sidebar with animation
  function toggleSidebar() {
    document.querySelector('.MenuDrawer')
      .classList.toggle('closed');

    // Timeout for animation to play
    setTimeout(() => {
      setMenu(false);
    }, 200);
  }

  return (
    <div className='MenuBackground'>
      <div onClick={() => setMenu(false)}></div>
      <div className='MenuDrawer'>
        <div className='MenuTop'>
          <button className='CloseMenu' onClick={() => toggleSidebar()}><img src={CloseImg}></img></button>
          <img className='MenuLogo' src={LogoImg} ></img>
        </div>
        <button className='MenuBtn'><img src={HomeImg}></img><p>Home</p></button>
        <button className='MenuBtn'><img src={ExploreImg}></img><p>Explore</p></button>
        <button className='MenuBtn'><img src={LibraryImg}></img><p>Library</p></button>
        <hr></hr>
        <button className='PlaylistBtn'><img src={AddImg}></img><p>New Playlist</p></button>
      </div>
    </ div>
  )
}

function TrackDetails() {
  return (
    <div className='TrackIcon'>
      <div className='TrackImg'> </div>
      <h2>Title</h2><p>Singers</p>
    </div>
  )
}

function SongCategory({ CategoryName = "ss" }) {
  return (
    <div className='SongCategory'>
      <p>{CategoryName}</p>
    </div>
  )
}

